import React from 'react';
import { Button } from '@mui/material';
import { Controller } from 'react-hook-form';

export default function InputButton(props) {
  return (
    <Controller
      name={props.name}
      type="submit"
      control={props.control}
      render={({ field }) => <Button {...field} />}
    />
  );
}
